import React from 'react';
import ListGroup from 'react-bootstrap/ListGroup';

class Song extends React.Component{
    constructor(props){
        super(props);
    }

    render(){
        return (<ListGroup.Item>{this.props.songName}</ListGroup.Item>);
    }
}

export default Song;
